import { CopyToClipboard } from 'react-copy-to-clipboard';
var shortLink = 'temp'
function changeShortLink(shortenedLink){
    console.log('THERE')
    console.log(shortenedLink)
    shortLink = shortenedLink
    this.reload()
}

function LinkResult() {
    console.log('HELLLOO')
    console.log(shortLink)
    return (
        <div className="result">
            <p>{shortLink}</p>
            <CopyToClipboard text={shortLink}>
                <button type='button' className='btn'>Copy</button>
            </CopyToClipboard>
        </div>
    )

}

export {LinkResult, changeShortLink}

export default function () {
    console.log("Hello from example.js");
}
